    `,listThumb:"/images/project/prj_unhuit.webp",detailThumb:"/images/project/prj_unhuit.webp",aboutWork:[{title:"アニメーションの実装",subTitle:"",text:`
          デザインを活かしつつ、視線を奪わない自然で滑らかなアニメーションを実装することが、今回の個人的な目標でした。
          <br>中でも、ンセプトページの滴がふわっと浮かぶようなアニメーションは特に気に入っているポイントです。
        `},{title:"絞り込み機能を含むカスタム投稿の実装",subTitle:"",text:`
          WordPressのカスタム投稿で、ニュース投稿機能を実装しました。
          <br>年度とカテゴリーによるAND絞り込みにも対応しており、目的の記事を探しやすい仕様になっています。
          <br>年度はアーカイブ、カテゴリーはパラメータによって判別する設計です。
        `},{title:"自作テンプレートでのお問い合わせフォームの実装",subTitle:"",text:`
